import React, { useState, useEffect } from "react";
import "../styles.css";
import axios from "axios";
import "particles.js";

const Register = () => {
  const [form, setForm] = useState({
    name: "",
    email: "",
    password: "",
  });

  useEffect(() => {
    // Load particles.js config
    window.particlesJS("particles-js", {
      particles: {
        number: { value: 80, density: { enable: true, value_area: 800 } },
        color: { value: "#00ffff" },
        shape: { type: "circle" },
        opacity: { value: 0.5 },
        size: { value: 3 },
        line_linked: { enable: true, color: "#00ffff", opacity: 0.4 },
        move: { enable: true, speed: 2 },
      },
      interactivity: {
        events: {
          onhover: { enable: true, mode: "repulse" },
          onclick: { enable: true, mode: "push" },
        },
      },
      retina_detect: true,
    });
  }, []);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleRegister = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post("/api/auth/register", form);
      localStorage.setItem("token", res.data.token);
      alert("Registration successful!");
      window.location.href = "/user";
    } catch (err) {
      console.error(err.response?.data || err.message);
      alert(err.response?.data?.message || "Registration failed. Try again.");
    }
  };

  return (
    <div className="login-container">
      <div id="particles-js"></div>
      <div
        className="login-box"
        style={{
          width: "340px",
          padding: "30px 25px",
          background: "rgba(0, 0, 0, 0.7)", // ðŸ”¥ transparent dark background
          border: "1px solid cyan",
          borderRadius: "15px",
        }}
      >
        <h2 style={{ fontSize: "24px", marginBottom: "8px", color: "#00ffff" }}>
          REGISTER
        </h2>
        <p style={{ fontSize: "13px", marginBottom: "18px", color: "#aaa" }}>
          Create your account
        </p>
        <form onSubmit={handleRegister}>
          <div className="input-box" style={{ marginBottom: "14px" }}>
            <label style={{ fontSize: "13px", color: "#ff4dff" }}>
              Full Name
            </label>
            <input
              type="text"
              name="name"
              value={form.name}
              onChange={handleChange}
              required
              style={{
                padding: "8px 10px",
                fontSize: "13px",
                background: "#111",
                color: "#0ff",
                border: "1px solid cyan",
              }}
            />
          </div>
          <div className="input-box" style={{ marginBottom: "14px" }}>
            <label style={{ fontSize: "13px", color: "#ff4dff" }}>
              Email Address
            </label>
            <input
              type="email"
              name="email"
              value={form.email}
              onChange={handleChange}
              required
              style={{
                padding: "8px 10px",
                fontSize: "13px",
                background: "#111",
                color: "#0ff",
                border: "1px solid cyan",
              }}
            />
          </div>
          <div className="input-box" style={{ marginBottom: "14px" }}>
            <label style={{ fontSize: "13px", color: "#ff4dff" }}>
              Password
            </label>
            <input
              type="password"
              name="password"
              value={form.password}
              onChange={handleChange}
              required
              style={{
                padding: "8px 10px",
                fontSize: "13px",
                background: "#111",
                color: "#0ff",
                border: "1px solid cyan",
              }}
            />
          </div>
          <button
            type="submit"
            className="btn"
            style={{ padding: "10px", fontSize: "14px", width: "100%" }}
          >
            Sign Up
          </button>
          <p
            className="register"
            style={{
              marginTop: "12px",
              fontSize: "13px",
              color: "#aaa",
            }}
          >
            Already have an account?{" "}
            <a href="/login" style={{ color: "#ff4dff", fontWeight: "bold" }}>
              Login here
            </a>
          </p>
        </form>
      </div>
    </div>
  );
};

export default Register;
